import React from 'react';
import  Professional from './Professional';
import  Personal from './Personal';
import  Upload from './Upload';
import  Varification from './Varification';
import { Route, Switch } from 'react-router-dom';
import './index.css';


const App = () => {

    return (
              <>
               <h1 className="text-center my-3">Helpworx Technology Private Limited</h1>
                     <div className="container mx-auto">
                         <div className="row blink">

                         <div class="btn-group my-5" role="group" aria-label="Basic radio toggle button group">
  <input type="radio" class="btn-check" name="btnradio" id="btnradio1" autocomplete="off"/>
  <label class="btn btn-outline-primary" for="btnradio1"><a href="/Personal">Personal Details</a></label>

  <input type="radio" class="btn-check" name="btnradio" id="btnradio2" autocomplete="off"/>
  <label class="btn btn-outline-primary" for="btnradio2"><a href="/Professional">Professional Details</a></label>

  <input type="radio" class="btn-check" name="btnradio" id="btnradio3" autocomplete="off"/>
  <label class="btn btn-outline-primary" for="btnradio3"><a href="/Upload">Upload Sample</a></label>

  <input type="radio" class="btn-check" name="btnradio" id="btnradio4" autocomplete="off"/>
  <label class="btn btn-outline-primary" for="btnradio4"><a href="/Varification">Varification</a></label>
</div>
                         

                         </div>
                     </div>
                 

               
                <Switch>
                    <Route exact path="/Personal" component={Personal}/>
                    <Route exact path="/Professional" component={Professional}/>
                    <Route exact path="/Upload" component={Upload}/>
                    <Route exact path="/Varification" component={Varification}/>
                </Switch>
                
              </>

    );
}
export default App;
